    $scope.getTotalfreightSectionOfgstAmount = function () {
        debugger;

        var total= $scope.getTotalAmountOfFreightSection();

        if (total === '' || total === null || total === undefined) {
            total = 0;
        }
        if ($scope.OrderFreightInformationObject.GSTPercentage === '' || $scope.OrderFreightInformationObject.GSTPercentage === undefined || $scope.OrderFreightInformationObject.GSTPercentage === null) {
            $scope.OrderFreightInformationObject.GSTPercentage = "";
        }
		var GstAmt = (total * $scope.OrderObject.GSTPercentage) / 100;

          GstAmt = parseFloat(Math.round(GstAmt * 100) / 100).toFixed(2)
        
        return GstAmt;
       
    }




    $scope.getTotalAmountOfFreightSection = function () {
        debugger;
        var total = 0;
        for (var i = 0; i < $scope.OrderFreightInformationList.length; i++) {

            total += parseFloat($scope.OrderFreightInformationList[i].Amount);
        }
 
        return total;
    }

    $scope.Gettotalpaybleamt = function ()
    {
        var amt = parseFloat( $scope.getTotalAmountOfFreightSection());
        var gst = parseFloat( $scope.getTotalfreightSectionOfgstAmount());

        var paybleAmt = parseFloat(Math.round((amt + gst) * 100) / 100).toFixed(2)

        return paybleAmt;
    }

