    $scope.GetLorryReceiptDetailByOrderId = function () {

        $rootScope.Throbber.Visible = true;

        try {



            var requestData =
                {
                    ServicesAction: 'GetLorryReceiptDetailByOrderId',
                    OrderId: $scope.OrderId

                };


            var consolidateApiParamater =
                {
                    Json: requestData,

                };



            GrRequestService.ProcessRequest(consolidateApiParamater).then(function (response) {



                if (response.data != undefined) {



                    $scope.OrderObject = response.data.Json.Order;

					

					$scope.OrderVolumeInformationList = response.data.Json.Order.OrderVolumeInformationList;



                    if (!(typeof response.data.Json.Order.OrderInsuranceInformationList == 'undefined' || response.data.Json.Order.OrderInsuranceInformationList === null)) {
                        // Do stuff

                        $scope.OrderInsuranceInformationList = response.data.Json.Order.OrderInsuranceInformationList;
                    }


                    if (!(typeof response.data.Json.Order.OrderInvoiceInformationList == 'undefined' || response.data.Json.Order.OrderInvoiceInformationList === null)) {
                        // Do stuff

                        $scope.OrderInvoiceInformationList = response.data.Json.Order.OrderInvoiceInformationList;
                    }



                    if (!(typeof response.data.Json.Order.OrderFreightInformationList == 'undefined' || response.data.Json.Order.OrderFreightInformationList === null)) {
                        // Do stuff

                        $scope.OrderFreightInformationList = response.data.Json.Order.OrderFreightInformationList;
                    }




                    $rootScope.Throbber.Visible = false;




                }
            });

        } catch (e) {
            $rootScope.Throbber.Visible = false;
            $rootScope.ValidationErrorAlert(String.format(e.Message), '', 3000);
        }
    }

    $scope.GetLorryReceiptDetailByOrderId();


