    // #region DownloadDocument

    $scope.PrintLorryReceiptReport = function () {


        var orderRequestData =
            {
                ServicesAction: 'GetLorryReceiptReportInPDFByOrderId',
                OrderId: $scope.OrderId

            }
        var jsonobject = {};
        jsonobject.Json = orderRequestData;
        GrRequestService.ProcessRequest(jsonobject).then(function (response) {


            if (response.data !== undefined) {




                var winparams = 'dependent=yes,locationbar=no,scrollbars=yes,menubar=yes,' +
                    'resizable,screenX=50,screenY=50,width=850,height=1050';

                var htmlPop = '<embed width=100% height=100%'
                    + ' type="application/pdf"'
                    + ' src="data:application/pdf;base64,' + response.data.Json.DocumentBlob
                    + '"></embed>';

                var printWindow = window.open("", "PDF", winparams);
                printWindow.document.write(htmlPop);
                //printWindow.print();






            } else {
                $rootScope.ValidationErrorAlert('Document not generated.', '', 3000);
            }
        });


    }

